import { MdMovieFilter } from "react-icons/md";
import { Link } from "react-router-dom";

const Header = function () {
  return (
    
    <header>
      <Link className="link" to="/"></Link>
        <h1>
          Movies & Series <MdMovieFilter />
        </h1>
      </header>
    
  );
};

export default Header;
